import{_ as t,c as r,o as c,a2 as a}from"./chunks/framework.4_bZ6nyl.js";const d=JSON.parse('{"title":"20180901 @台江國家公園 [假日騎士日誌]","description":"","frontmatter":{"title":"20180901 @台江國家公園 [假日騎士日誌]","date":"2018-09-01T09:42:09.000Z","categories":["假日騎士日誌"]},"headers":[],"relativePath":"Bike/BikeTravel/20180901_台江國家公園.md","filePath":"Bike/BikeTravel/20180901_台江國家公園.md"}'),s={name:"Bike/BikeTravel/20180901_台江國家公園.md"},i=a('<p><img src="https://farm2.staticflickr.com/1882/29509431887_4236b188dd.jpg" alt=""><br> 半年前剛開始上卡時，有規劃過台江國家公園路線<br> 但是上次來的時候，發現外面停很多車，人也很多<br> 加上那次是第一次上卡摔車，後來就沒有參觀了</p><p>不過事隔半年，現在很熟悉上下卡，也不再摔車了<br> 但是夏天容易下雨，天雨路滑這陣子改騎登山車<br> 最近都是陰天下雨的天氣，天空總是佈滿雲彩</p><p>這次的早餐吃網路上有名的文章牛肉湯<br> 其實清明時有同事來台南玩，吃過一次<br> 上次人多，吃飯會有壓力，這次一早沒人<br> 店家給的牛肉很多，醬料是加洋蔥(沒拍到)<br> 點牛肉湯會贈送白飯，算是料很實在<br><img src="https://farm2.staticflickr.com/1891/42638059490_5b2da95d90.jpg" alt=""><br><img src="https://farm2.staticflickr.com/1896/42638054810_57135d53c1.jpg" alt=""></p><p>吃完後又沿著水鳥公園的腳踏車道前進<br> 這次雲層較厚，拍出來都是白白的雲<br><img src="https://farm2.staticflickr.com/1871/42638049920_9dc9ca2cb0.jpg" alt=""><br><img src="https://farm2.staticflickr.com/1854/42638042510_4306b85057.jpg" alt=""><br> 半路上一個寄居蟹快速爬過，等拿出相機已跑遠<br><img src="https://farm2.staticflickr.com/1888/42638039200_555f3ff98f.jpg" alt=""></p><p>這次大部分的照片都是倒影，陰天很適合拍<br><img src="https://farm2.staticflickr.com/1860/42638032270_5b72709f6f.jpg" alt=""><br> 淡藍色的天空，加上雲彩，以及白色建築<br> 工整的線條，整個給人乾淨整齊的感覺<br><img src="https://farm2.staticflickr.com/1884/44398161342_a4fe2003dd.jpg" alt=""><br><img src="https://farm2.staticflickr.com/1882/29509431887_4236b188dd.jpg" alt=""><br><img src="https://farm2.staticflickr.com/1896/44447397581_1d02c8eaf5.jpg" alt=""><br><img src="https://farm2.staticflickr.com/1859/44398145502_5d6f74a172.jpg" alt=""><br><img src="https://farm2.staticflickr.com/1870/30578281398_8f09a88d64.jpg" alt=""><br> 牆角的植物-射干，顏色相當的鮮豔<br><img src="https://farm2.staticflickr.com/1888/43538219235_01cf32619c.jpg" alt=""><br><img src="https://farm2.staticflickr.com/1845/43729765524_0ed03cb57d.jpg" alt=""><br> 繼續一樣是倒影篇，怎麼看都不會膩<br><img src="https://farm2.staticflickr.com/1841/44398105332_c472434ccf.jpg" alt=""><br><img src="https://farm2.staticflickr.com/1882/44398094782_cf6878ac71.jpg" alt=""><br> 因為來的比較早，這邊其實有店家，但未開<br><img src="https://farm2.staticflickr.com/1899/43729740664_ab532c4103.jpg" alt=""><br> 旁邊有一些植物，繼續拍，好像之前有拍過<br> (大花咸豐草、南美蟛蜞菊)<br><img src="https://farm2.staticflickr.com/1888/43729730394_931cc837d9.jpg" alt=""><br><img src="https://farm2.staticflickr.com/1866/44398063142_8ec727b2f6.jpg" alt=""><br><img src="https://farm2.staticflickr.com/1882/29509335817_9b3866f0fd.jpg" alt=""></p>',5),m=[i];function f(p,_,l,e,b,o){return c(),r("div",null,m)}const k=t(s,[["render",f]]);export{d as __pageData,k as default};
